Defendant Onesimus M Browne in court with attorney Gregory A. Renden.  Defendant Onesimus M Browne in custody.  Antonella Aleman appeared for the State of Wisconsin.
 Pursuant to plea negotiations and on motion of the State, Court ordered count 2 dismissed and read in.
AS TO COUNT 1:   Defendant changes plea to GUILTY. Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty. Court found that defendant freely, voluntarily and intelligently waived his rights. Plea questionnaire received and filed. Parties stipulate to the complaint as a factual basis to sustain defendant's plea. Court found defendant guilty as charged in the information and ordered a Judgment of Conviction be entered on the record. Defendant is advised he is a convicted felon and may not possess any firearms. Defendant is advised he is unable to vote in any election until civil rights are restored. Defendant further advised that if he is not a US citizen deportation is possible.  

The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 42 MONTHS, with credit for 106 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 2 YEARS.  The defendant is eligible for the Challenge Incarceration Program and THE COURT DID NOT ADDRESS the "Wisconsin Substance Abuse Program".
Defendant shall provide a DNA sample for the Data Bank and pay all appropriate costs by 11.9.15 be paid through collection by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision. DOC shall collect those sums.  Any amount remaining due and owing is subject to civil judgment and/or tax intercept or other means.
Court ordered defendant to pay all applicable court costs and surcharges 11.9.15 or, if not paid,be paid through collection by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision. DOC shall collect those sums.  Any amount remaining due and owing is subject to civil judgment and/or tax intercept or other means.
Court advised defendant that as a convicted felon he may never possess a firearm or body armor. Court advised defendant that his voting rights are suspended and he may not vote in any election until his civil rights are restored. 
